import { BaseNodeUnion } from "../base.js";
export const Literal = class extends BaseNodeUnion {
  // type = 'Literal' as const;
  constructor(ctx, visitor) {
    super(
      ctx,
      [
        ctx.stringLiteral(),
        ctx.numberLiteral(),
        ctx.booleanLiteral(),
        ctx.hexStringLiteral(),
        ctx.unicodeStringLiteral()
      ],
      visitor
    );
  }
};
